import Header from "../Header";
import "./index.css";
const Home = () => {
  return (
    <>
      <Header />
      <div>
        <div>
          <div>
            <img
              src="https://res.cloudinary.com/dzscdp79g/image/upload/v1693987778/ww-top-domains-E4KGGK_vr9edj.jpg"
              alt=""
            />
            <h1>Zig Zag Alphabets</h1>
          </div>
        </div>
      </div>
    </>
  );
};
export default Home;
